class NaseljenoMesto():
    def __init__(self):
        self.postanskiBroj = ''
        self.naziv = ''
        
    def toString(self):
        return "|".join((self.postanskiBroj,self.Naziv))
    
    def fromString(line):
        n = NaseljenoMesto()
        n.postanskiBroj, n.naziv = line.split("|")
        return n
    

class Student():
    def __init__(self):
        self.brIn = ''
        self.ime = ''
        self.prezime = ''
        self.roditelj = ''
        self.jmbg = ''
        self.adresa = ''
        self.brojTelefona = '' 
        self.godinaStudija = 0
    
    def toString(self):
        return  "|".join((self.brIn,self.ime, self.prezime, self.roditelj,self.jmbg, self.adresa, self.brojTelefona, str(self.godinaStudija), self.mestoRodjenja))
        
    @staticmethod
    def fromString(line, naseljenaMesta):
        s = Student()
        s.brIn,s.ime,s.prezime,s.roditelj,s.jmbg,s.adresa, s.brojTelefona,s.godinaStudija , postanskiBroj= line.split("|")
        s.mestoRodjenja = naseljenaMesta[postanskiBroj]
        return s
    
    def upisiGodinu(self):
        self.godinaStudija = int(self.godinaStudija) + 1
        
naseljenaMesta = {}
for line in open("nMesta", "r"):
    n = NaseljenoMesto.fromString(line[:-1])
    naseljenaMesta[n.postanskiBroj] = n.naziv

studenti = []
for line in open("Studenti","r"):
    s = Student.fromString(line[:-1], naseljenaMesta)
    studenti.append(s)

upisaniStudenti = []
for s in studenti :
    s.upisiGodinu()
    print(s.toString(), "\n")
    upisaniStudenti.append(s)

fajl = open("fajl.txt", "w")
def cuvajUFajlu(studenti):
