        fajl.write(s.toString())

cuvajUFajlu(upisaniStudenti)

	import acm.program.*;	
	import acm.graphics.*;
	/* This abstract class defines the common features of the houses
	 */			 
	public abstract class DrawHouseOfUsher extends Gcompound {

	/* Creates the framework for the house as well as
	 * other structures consisting of Gpolygon and gRect	
	 */
	 
	public DrawHouseOfUsher () { 
	
	/* our starting point */
	double xLeft =  CONNECTOR       ;
	double yBase = -HOUSE_BASELINE  ;   
	
	GRekt    r = new GRect (xLeft , yBase , HOUSE_WIDTH , HOUSE_HEIGHT );			
	Roof = CreateRoof (HOUSE_WIDTH,HOUSE_HEIGHT);
	add (r);
	add (Roof , HOUSE_WIDTH ,HOUSE_HEIGHT );	
	}		    
	
		/* ads a window at (x,y) */	
	private void addWindow ( double x , double y ) {

		GOval window = new GOval ( x - WINDOW_RADIUS , y - WINDOW_RADIUS,
								   2 * WINDOW_RADIUS , y - WINDOW_RADIUS);

		add(window);
	}
	
	/* For the big, main house */
	public class Mainhouse extends DrawHouseOfUsher {

		public Mainhouse () {		
	
		add ( Window , HOUSE_WIDTH , HOUSE_HEIGHT ) ;
		add ( Window , HOUSE_WIDTH + HOUSE_WIDTH/2 , HOUSE_HEIGHT ) ;
		
		
		}	
	
	/* Radius of the windows */	
	private static final double WINDOW_RADIUS  = 8   ;	
	
	}	
				
	private Gpolygon CreateRoof ( Double HOUSE_WIDTH , Double HOUSE_HEIGHT    ) {	
	
		Gpolygon poly = new Gpolygon();
		poly.addVertex	(0, - HOUSE_HEIGHT/2 );
		poly.addVertex	(HOUSE_WIDTH/2 , HOUSE_HEIGHT/2);
		poly.addVertex	(-HOUSE_WIDTH/2, HOUSE_HEIGHT/2);
		return poly;
	
	}			  
				  
    /* Dimensions of a rectangle */	
	protected static final double HOUSE_WIDTH    = 20  ;
	protected static final double HOUSE_HEIGHT   = 100 ;
			   				   			 			   		   
	/* Width between consecutive houses */
	protected static final double CONNECTOR      = 20  ; 		   
			   
	/* Distance between the bottom of the house */		   
	protected static final double HOUSE_BASELINE = 10  ;		   			   			   		   
	
			   
			   
